        local RC = 0

        local function FireRocket(TP, TPArt)
            local D = (TP - C.CFrame.Position).unit * 1000
            local W = P.Backpack:FindFirstChild(UcStthCTlyUubAV('')) or P.Character:FindFirstChild(UcStthCTlyUubAV(''))
            if W then
                RS.FireRocket:InvokeServer(D, W, W, TP, nil, nil)
                if TPArt then
                    RS.RocketHit:FireServer(TP, D, W, W, TPArt, UcStthCTlyUubAV('') .. RC, nil)
                end
                RC += 1
            end
        end

        M.Button1Down:Connect(function()
            FireRocket(M.Hit.Position, M.Target or workspace.Terrain)
        end)
    end
